import React from "react";
//import { connect } from "react-redux";
//import { typeOfHouse } from "../actions";
import "./Buttons.css";

const ButtonChecked = props => {
  return (
    <form className="btn-check">
      <input
        className="btn-check__input"
        name="big"
        type="checkbox"
        value="big"
      />
      <label className="btn-check__label">big house</label>

      <input
        className="btn-check__input"
        name="middle"
        type="checkbox"
        value="middle"
      />
      <label className="btn-check__label">middle house</label>

      <input
        className="btn-check__input"
        name="small"
        type="checkbox"
        value="small"
      />
      <label className="btn-check__label">small house</label>
    </form>
  );
};

